const Product = ({post}) => {
  return(
    <div>
      <div>
        <p>{post.title}</p>
      </div>
      <div>
        <p>{post.description}</p>
      </div>
      <div>
        <img src={post.image} alt=""/>
      </div>
      <div>
        <p>{post.price}</p>
      </div>
      <div>
        <button>
          {
            true ? <p>Remove Item</p> : <p>Add to cart</p>
          }
        </button>
      </div>
    </div>
  )
};

export default Product;
